  leq 30\n* 0 \\leq x_i \\leq H-1\n* 0 \\leq y_i \\leq W-1\n* If i \\neq j, then either\
  \ x_i \\neq x_j or y_i \\neq y_j.\n* There is at least one white square.\n* For\
  \ every pair of white squares A and B, it is possible to reach B from A visiting\
  \ only white squares.\n\nInput\n\nInput is given from Standard Input in the following\
  \ format:\n\n\nH W\nN\nx_1 y_1\nx_2 y_2\n:\nx_N y_N\n\n\nOutput\n\nPrint the sum\
  \ of the shortest distances, modulo 10^9+7.\n\nExamples\n\nInput\n\n2 3\n1\n1 1\n\
  \n\nOutput\n\n20\n\n\nInput\n\n2 3\n1\n1 2\n\n\nOutput\n\n16\n\n\nInput\n\n3 3\n\
  1\n1 1\n\n\nOutput\n\n64\n\n\nInput\n\n4 4\n4\n0 1\n1 1\n2 1\n2 2\n\n\nOutput\n\n\
  268\n\n\nInput\n\n1000000 1000000\n1\n0 0\n\n\nOutput\n\n333211937\nA: ```from collections\
  \ import deque, Counter\nimport sys\nsys.setrecursionlimit(10 ** 7)\ninput = sys.stdin.readline\n\
  \nmod = 10**9 + 7\nh, w = map(int, input().split())\nn = int(input())\n\nans = 0\n\
  \nblack = []\nrow = Counter()\ncolumn = Counter()\nfor _ in range(n):\n    x, y\
  \ = map(int, input().split())\n    row[x] += 1\n    column[y] += 1\n    black.append((x,\
  \ y))\nrow[h] += 1\ncolumn[w] += 1\n\n\ndef sqsum(x):\n    return x*(x+1)*(2*x+1)//6\n\
  \n\npre = -1\ntop = 0\nbottom = h*w - n\narea = []\nfor i in sorted(row.keys()):\n\
  \    if i == pre+2:\n        top += w\n        bottom -= w\n        area.append([-1,\
  \ 1])\n    elif i > pre+2:\n        ans += (i-pre-2)*top*bottom + ((i-pre-2)*(i-pre-1)//2)\
  \ * \\\n            w*(bottom-top) - sqsum(i-pre-2)*(w**2)\n        ans %= mod\n\
  \        top += (i-pre-1)*w\n        bottom -= (i-pre-1)*w\n        area.append([-1,\
  \ i-pre-1])\n    if i != h:\n        top += w-row[i]\n        bottom -= w-row[i]\n\
  \        area.append([i])\n    pre = i\n\nR = len(area)\n\npre = -1\nleft = 0\n\
  right = h*w-n\narea2 = []\nfor j in sorted(column.keys()):\n    if j == pre+2:\n\
  \        left += h\n        right -= h\n        area2.append([area[i][1] if area[i][0]\
  \ == -1 else 1 for i in range(R)])\n    elif j > pre+2:\n        ans += (j-pre-2)*left*right\
  \ + ((j-pre-2)*(j-pre-1)//2) * \\\n            h*(right-left) - sqsum(j-pre-2)*(h**2)\n\
  \        ans %= mod\n        left += (j-pre-1)*h\n        right -= (j-pre-1)*h\n\
  \        area2.append([(j-pre-1)*area[i][1] if area[i][0]\n                    \
  \  == -1 else (j-pre-1) for i in range(R)])\n    if j != w:\n        left += h-column[j]\n\
  \        right -= h-column[j]\n        tmp = []\n        for i in range(R):\n  \
  \          if area[i][0] == -1:\n                tmp.append(area[i][1])\n      \
  \      else:\n                if (area[i][0], j) in black:\n                   \
  \ tmp.append(0)\n                else:\n                    tmp.append(1)\n    \
  \    area2.append(tmp)\n    pre = j\n\n\nC = len(area2)\narea2 = [[area2[j][i] for\
  \ j in range(C)] for i in range(R)]\n\nvec = [[1, 0], [0, 1], [-1, 0], [0, -1]]\n\
  \n\ndef bfs(p, q):\n    dist = [[10**5 for _ in range(C)] for __ in range(R)]\n\
  \    visited = [[False for _ in range(C)] for __ in range(R)]\n    dist[p][q] =\
  \ 0\n    visited[p][q] = True\n    q = deque([(p, q)])\n    while q:\n        x,\
  \ y = q.popleft()\n        for dx, dy in vec:\n            if 0 <= x+dx < R and\
  \ 0 <= y+dy < C and area2[x+dx][y+dy] != 0:\n                if not visited[x+dx][y+dy]:\n\
  \                    dist[x+dx][y+dy] = dist[x][y] + 1\n                    visited[x+dx][y+dy]\
  \ = True\n                    q.append((x+dx, y+dy))\n    return dist\n\n\nans2\
  \ = 0\n\nfor x in range(R*C):\n    i = x//C\n    j = x % C\n    if area2[i][j] ==\
